import axios from 'axios'

export const registration = async (nickname, password) => {
    try {
        const response = await axios.post(`http://localhost:5000/api/auth/registration`, {
            nickname,
            password
        })
        alert(response.data.message)
    } catch (e) {
        alert(e)
    }

}
